import './App.css';
import { Link, Route, Routes } from 'react-router'
import 'bootstrap/dist/css/bootstrap.min.css';
import landscape from './assets/landscape.png'
import BlogCard from './BlogCard';
import Abstract from './Abstract';
import data from './assets/blog-db.json'
function App() {
  return (
    <>
      <nav className='container'>
        <ul className='row text-center p-4'>
          <li className='col'>Andrew Brown Blog</li>
          <li className='col'><a>Home</a></li>
          <li className='col'><a>About</a></li>
          <li className='col'><a>Contact</a></li>
        </ul>
      </nav>
      <div className='container'>
        <main className='container'>
          <Abstract />
          <h1 className='col-12 text-center'>Most Recent Posts</h1>
          <section id='recent posts' className='row row-cols-1 row-cols-sm-2 row-cols-md-3 g-2'>
            {data.blogEntries?.map(entry => {
              return <BlogCard id={entry.id} title={entry.title} date={entry.date} image={entry.image} />
            })}
            <BlogCard picture={landscape} />
            <BlogCard picture={landscape} />
            <BlogCard picture={landscape} />
            <BlogCard picture={landscape} />
            <BlogCard picture={landscape} />
            <BlogCard picture={landscape} />
          </section>
        </main>
      </div>
    </>
  );
}

export default App;
